import React from 'react'
import Sidebar from '../Nav/Sidebar'
import Lebenslauf from '../components/Resume/Lebenslauf'
import Contact from '../components/Resume/Contact'
import Vorstellung from '../components/Resume/Vorstellung'

import styled from "styled-components";

const Page = styled.div`
    @media (min-width: 48em) {
        max-width:80em;
    }   
    @media (min-width: 64em) {
        margin-left:auto;
        margin-right:auto;
    }
`

const Sections = styled.div`
    margin:0;
    @media (min-width: 48em) {
        margin-left:calc(var(--sidebar-width));
        margin-right:calc(var(--sidebar-width));
    }  
    @media (min-width: 64em) {
    }      
`

export default function Resume() {

    const data=[
        {
            id:'about',
            label:'About Me',
        },
        {
            id:'resume',
            label:'Resume',
        },
        {
            id:'contact',
            label:'Contact',
        }
    ]

    return (
        <Page>
            <Sections>
                <div id='about'><Vorstellung/></div>
                <div id='resume'><Lebenslauf/></div>
                <div id='contact'><Contact/></div>
            </Sections>
            <Sidebar data={data}/>
        </Page>
    )
}
